"use strict";

const inf = Number.POSITIVE_INFINITY;
const Counter = class {
    constructor(iterable) {
        this.counter = new Map();
        if (iterable) {
            for (const item of iterable) {
                this.set(item, this.get(item) + 1 || 1);
            }
        }
    }
    get(item) {
        return this.counter.get(item) || 0;
    }
    set(item, count) {
        this.counter.set(item, count);
    }
    delete(item) {
        this.counter.delete(item);
    }
    keys() {
        return this.counter.keys();
    }
    values() {
        return this.counter.values();
    }
    items() {
        return this.counter.entries();
    }
    clear() {
        this.counter.clear();
    }
    size() {
        return this.counter.size;
    }
    toString() {
        return `[object Counter(${[...this.counter.entries()]})]`;
    }
};

function f_gold(s, t) {
    let ans = '';
    const m = s.length, n = t.length;
    if (m < n) {
        return ans;
    }
    const need = new Counter(t);
    const window = new Counter();
    let i = 0, cnt = 0, mi = inf;
    for (let j = 0; j < m; j++) {
        const c = s[j];
        window.set(c, window.get(c) + 1);
        if (need.get(c) >= window.get(c)) {
            cnt += 1;
        }
        while (cnt === n) {
            if (j - i + 1 < mi) {
                mi = j - i + 1;
                ans = s.slice(i, j + 1);
            }
            const c = s[i];
            if (need.get(c) >= window.get(c)) {
                cnt -= 1;
            }
            window.set(c, window.get(c) - 1);
            i += 1;
        }
    }
    return ans;
}
